import React from "react";
import { View, Text, Heading, Center, NativeBaseProvider,Stack, Container, Image } from "native-base";





const AboutCinema = () => {
    return(
                <Center bg={'amber.100'}>
                    <Image bg={'amber.100'} p={10} margin={10} safeArea source={require('../../resources/popi.gif')} alt="Loading" />
                </Center>

    )
};

export default AboutCinema;
